    var judge=1;
    for(var item in funcdata[pd]){
       // pd pd1 item turn1
       if(item!=='AC'&&item!=='IR'&&item!=='CK')
            continue;
      //  node.warn(item.toString());
        var upper=lmt[item].upper;
        var lower=lmt[item].lower;
