function checklmt() {
    let lmt = flow.get('limits');
    if (lmt === undefined)
        return false;

    for (var objkey in lmt) {
        let obj = lmt[objkey];
        if (typeof (obj.master) !== 'number' || isNaN(obj.master)) {
            return false;
        }
        if (typeof (obj.upper) !== 'number' || isNaN(obj.upper)) {
            return false;
        }
        if (typeof (obj.lower) !== 'number' || isNaN(obj.lower)) {
            return false;
        }
    }
    return true;
}
